import { NavLink } from 'react-router-dom';
import '../../styling/nav.css';
import Form from '../authentication/Form';
const Nav = () => {
	return (
		<nav>
			<div className='nav--ul'>
				<Form />
				<NavLink to='/'>
					<li>Home</li>
				</NavLink>
				<NavLink to='/settings'>
					<li>Settings</li>
				</NavLink>
			</div>
		</nav>
	);
};
export default Nav;
